
(function(){var loaded=[];function getBaseName(file){var protocol=file.substr(0,file.indexOf(":")),nameSplit,fileName;protocol=file.substr(0,file.indexOf(":"));if(!!protocol.length){throw new Error("Scripts must be on same domain as document.");}
nameSplit=file.split("/");fileName=nameSplit[nameSplit.length-1];return fileName;}
function getHttpObject(){var xhr=false;if(window.XMLHttpRequest){xhr=new XMLHttpRequest();}else if(window.ActiveXObject){try{xhr=new ActiveXObject("Msxml2.XMLHTTP");}catch(e){try{xhr=new ActiveXObject("Microsoft.XMLHTTP");}catch(e){xhr=false;}}}
return xhr;}
window.namespace=function(){var i,il,objects,start,root,j,jl;for(i=0,il=arguments.length;i<il;i++){objects=arguments[i].split(".");start=(objects[0]==="window")?1:0;root=window;for(j=start,jl=objects.length;j<jl;j++){root[objects[j]]=root[objects[j]]||{};root=root[objects[j]];}}
return root;};window.include=function(file){var i,il,request,wrapper,name=getBaseName(file);name=getBaseName(file);for(i=0,il=loaded.length;i<il;i++){if(name===loaded[i]){return true;}}
request=getHttpObject();if(request){request.open("GET",file,false);request.send(null);}else{throw new Error("Couldn't create HTTP object.");}
wrapper="(function () {"+request.responseText+"})();";try{eval(wrapper);}catch(e){throw new Error("Exceptions thrown in "+name+": "+e.message);}
loaded.push(name);return true;};})();